// ===============================================================================================================================================================================
// this function will initialize multi select dropdown
function InitializeMultiSelect(id, enable, placeholder) {
    var rolesIdsInput = $('#' + id).data("kendoMultiSelect");
    rolesIdsInput.setOptions({
        autoClose: false,
        filter: "contains"
    });
    if (enable == 'true') {
        rolesIdsInput.setOptions({
            enable: false,
            placeholder: placeholder
        });
        rolesIdsInput._placeholder();
        rolesIdsInput._enable();
    }
}
