function customNotify(type, msg, time) {
    if (type == 'remove') { PNotify.defaultStack.close(); return; }
    if (type == true) { type = 'success'; } else if (type == false) { type = 'error'; }
    if (time == undefined) { time = 1500; }
    PNotify.defaultStack.close();
    switch (type) {
        case 'success': PNotify.success({ title: $('.pn-success').text(), text: msg, delay: time, icon: false }); break;
        case 'error': PNotify.error({ title: $('.pn-error').text(), text: msg, delay: time, icon: false }); break;
        case 'warning': PNotify.notice({ title: $('.pn-warning').text(), text: msg, delay: time, icon: false }); break;
        case 'info': PNotify.info({ title: $('.pn-info').text(), delay: time, icon: false }); break;
    }
}

// customNotify /*--------------------------------------------------------------------------------------End------------------------------------------------------------------------------*/


// genericMpOpner /*--------------------------------------------------------------------------------------Start------------------------------------------------------------------------------*/

$(function () {
    $(document).on('click', '.genericMPOpener', function (e) {
        e.preventDefault();
        var that = $(this);
        if (!$(this).hasClass('MpAdded')) {
            $(this).addClass('MpAdded');
            $(this).magnificPopup({
                type: 'iframe',
                closeOnContentClick: !that.hasClass('bgNoClose'),
                modal: that.hasClass('bgNoClose'),
                closeBtnInside: false,
            }).magnificPopup('open');
        } else {
            $(this).magnificPopup('open');
        }
    });
});

// genericMpOpner /*--------------------------------------------------------------------------------------End------------------------------------------------------------------------------*/